import {Link} from 'react-router-dom';


function Nav (){ 
    return ( 
        <>
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className='container-fluid'>
                <Link to='/'>
                <img className='icon'
                src="https://img.icons8.com/nolan/64/e-learning.png"
                alt="E-Learning"
              />
              E-Learning
                </Link>
            </div>
        </nav>
        <h2>bnkdnvs;</h2>
        </>
    )
}

export default Nav;
